import React from 'react';

function StudyPlanner() {
    return (
        <div style={{ textAlign: "center", padding: "50px" }}>
            <h2>Study Planner</h2>
            <p>Plan your study schedule effectively.</p>
        </div>
    );
}

export default StudyPlanner;
